import React, { useState } from 'react';
import {List, Button} from 'antd';
import {Container} from './style';
import {data} from './questoes';

export default function Relatorio({RA, setLeitura}){

    return(
        <Container>
            <Button onClick={()=>setLeitura(false)}>Voltar</Button>
            <List
                itemLayout="horizontal"
                dataSource={data}
                renderItem={item => (
                <List.Item>
                    <List.Item.Meta
                    title={<h3>{item.pergunta}</h3>}
                    description={item.resposta}
                    />
                </List.Item>
                )}
            />
        </Container>
    );
}
